pub fn find_in_special_groups(ch: u32) -> Option<SpecialGroup> {
    let record_idx = SPECIAL_GROUPS
        .binary_search_by(|record| {
            use std::cmp::Ordering;
            if record.1 < ch {
                Ordering::Less
            } else if record.0 > ch {
                Ordering::Greater
            } else {
                Ordering::Equal
            }
        })
        .ok()?;
    let group = SPECIAL_GROUPS[record_idx].2;
    Some(group)
}

